import React from "react";

function CreateQuizPopup() {
  return (
    <div
      style={{
        paddingBottom: "10vh",
        paddingTop: "5vh",
        paddingRight: "2.5vw",
        paddingLeft: "2.5vw",
        marginLeft: "3vw",
        backgroundColor: "white",
        borderRadius: "10px",
        width:"40vw"
      }}
    >
      <input
        style={{
          marginTop:"3vh",
          marginLeft:"1vw",
          marginRight:"1vw",
          paddingTop: "1vh",
          paddingBottom: "1vh",
          paddingLeft: "1vw",
          paddingRight: "1vw",
          height:"5vh",
          width:"35vw",
          fontSize:"1.2em"
        }}
        type="text"
        placeholder="Hi"
      ></input>
    </div>
  );
}

export default CreateQuizPopup;
